import base64, os
import vertexai
from vertexai.preview.generative_models import GenerativeModel, Part

PROJECT_ID = "gemini-pro-video"
LOCATION = "us-central1"
vertexai.init(project=PROJECT_ID, location=LOCATION)
# os.environ["GOOGLE_APPLICATION_CREDENTIALS"] = "C:/Users/sstgi/Downloads/gemini-pro-video-f6a9eabe4fb2.json"

def generate():
  model = GenerativeModel("gemini-pro-vision")
  responses = model.generate_content(
    [video1, """Analyze the video from a radiologist perspective. Also, provide a detailed summary as to possible abnormalities with explanation and suggestion if found"""],
    generation_config={
        "max_output_tokens": 2048,
        "temperature": 0.4,
        "top_p": 1,
        "top_k": 32
    },
  stream=True,
  )
  
  for response in responses:
      print(response.candidates[0].content.parts[0].text)

video1 = Part.from_data(data=base64.b64decode(""""""), mime_type="video/mp4")

generate()